import React from "react";
import "./App.css";
import Checkout from "./Checkout";
import Header from "./Header";
import Home from "./Home";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
	return (
		<Router>
			<div>
				<Routes>
					<Route
						path="/checkout"
						element={
							<div>
								<Header /> <Checkout />
							</div>
						}
					></Route>
					<Route path="/" component={Home}>
						{/* <Header />
						<Home /> */}
					</Route>
				</Routes>
			</div>
		</Router>
	);
}

export default App;
